import React from 'react'
import EventDetailPage from './EventDetail';

const DUMMY_EVENTS = [
  {id: 'e1', title: 'Event 1', description: 'Super cool event!'},
  {id: 'e2', title: 'Event 2', description: 'Super awesome event!'},
  {id: 'e3', title: 'Event 3', description: 'Super nully event!'},
];

const EventsPage = () => {
  return (
    <>
      {DUMMY_EVENTS.map( event => (
        <EventDetailPage
          key={event.id}
          id={event.id}
          title={event.title}

        />
      ) )}
    </>
  )
}

export default EventsPage
